    return(
        <nav>
        <ul className="holder">
            <li><a className="activo" href="/">Inicio</a></li>
            <li><NavLink to="/ensenanza">Ense√±anza</NavLink></li>
            <li><NavLink to="/copa">Copa</NavLink></li>
            <li><NavLink to="/interclubes">Interclubes</NavLink></li>
            <li><NavLink to="/galeria">Galeria</NavLink></li>
            <li><NavLink to="/contacto">Contacto</NavLink></li>
        </ul>
    </nav>
    );
}

export default Nav;
